    function check_FF(T, V)
    {
        //0 = TRUE, 1 = FALSE
        var flag = 0;
        var ffNo = $('#' + T + V).val();



        if (ffNo === '')
        {
            swal("", "Please input FF No.", "warning");
            flag = 0;
            return false;
        } else if (ffNo.length !== 12)
        {
            swal("", "Sorry, invalid FF No.", "error");
            flag = 1;
            return false;
        }

        $.ajax(
                {
                    url: 'https://www.sriwijayaair.co.id/SJ/Flights/check_FF',
                    type: "POST",
                    data: {
                        FF_NO: ffNo
                    },
                    success: function (data)
                    {
                        data = data.trim();
                        if (data) {
                            loadingHide();
                            flag = 0;
                            var json = JSON.parse(data);
                            swal('', 'Hello ' + json.TITLE + ' ' + json.FIRST_NAME + ' ' + json.LAST_NAME, "success");
                        } else {
                            loadingHide();
                            flag = 1;



                            swal("", "Sorry, invalid FF No.", "error");
                            if (ffNo == '')
                                flag = 0;
                            else
                                flag = 1;


                        }
                        $('#checkValidFF').val(flag);
                    },
                    error: function (jqXHR, textStatus, errorThrown)
                    {
                        loadingHide();
                        //if fails 
                        //swal('', 'fail to login');
                    },
                    beforeSend: function (d) {
                        loadingShow();

                    }
                });
    }





